import React from 'react';
import './Intro.css';
import headshot from '../../assets/headshot.jpeg';

const Intro = (props) => {

    return (
        <div className="intro-container">
            <div className="intro-background">
                <div className="info-container">
                    <img
                        alt="headshot"
                        src={headshot}
                        className="headshot"
                    />
                </div>
            </div>
        </div>
    );
}

export default Intro;
